INSERT INTO `servicio` (`id`, `titulo`, `descripcion`, `estatus`) VALUES
(1, 'Proyectos arquitectonicos', 'Proyectos de cocinas estilo italiano y Closets con el diseño minimalista de Gazebo. Fabricados en nuestros talleres de carpinteria, con materiales importados de comprobada calidad. Tiempos de Fabricación de 1 mes e instalacion de hasta 2 dias maximo. \r\nPonemos a su disposición un equipo de profesionales, dedicados a ofrecerles diseños adaptados a sus espacios y necesidades ,poniendo enfasis en los detalles, cumpliendo con los estandares mas altos de fabricación de mobiliario.\r\nAdicionalmente ofrecemos diseño y fabricación de muebles de baños , TV y mobiliario en general para complementar su hogar en toda Venezuela.', 1),
(2, 'Diseño de interiores', 'Con nuestro equipo de arquitectos y herramientas gráficas les ofrecemos el diseño y/o ejecución de proyectos de remodelación y diseño de espacios interiores y exteriores para el hogar u oficina. Complementamos estos proyectos con entregas digitales y gráficas necesarias para la ejecución y control de los mismos. \r\nOfreciendo nuestra linea minimalista como base para el diseño de espacios prolijos y funcionales.', 1),
(3, 'Fabricantes y distribuidores', 'Somos fabricantes de cocinas estilo italiano, closets, muebles de TV , mobiliario en general siguiendo nuestra linea minimalista. Además suministramos e instalamos mármoles, granitos, silestone y piedra en general para pisos, topes y paredes.\r\nSomos distribuidores exclusivos Hunter Douglas , nos ocupamos de proyectos de cualquier escala ofreciendo servicio impecable en instalación y mantenimiento de los productos Hunter Douglas.\r\nTambién ofrecemos puertas de baño en vidrio y pisos flotantes Kronopol, asi como su instalación.\r\nContamos con excelente personal calificado y excelente tiempo de respuesta. Nos mantenemos en constante búsqueda de materiales y productos para siempre ofrecerles lo mas innovador en interiorismo y arquitectura.', 1),
(4, 'Revestimientos', 'Suministramos Piedras Naturales: Marmoles, Travertinos, Granitos. Mosaicos y Silestone. Instalamos: Topes de Cocinas y Baños,  Revestimos Pisos y Paredes, Cristalizamos y Pulimos Pisos de marmol y granito. Ofrecemos material de primera con la calidad de instalacion que solo Gazebo le puede dar. \r\n', 1),
(5, 'Puertas de Baño ', 'Ofrecemos puertas de baño correderas,batientes y mamparas en vidrio templado, las primeras con instalacion inmediata y las otras con un periodo de entrega de menos de un mes.', 0);
